import React from 'react'
import {useState, useEffect} from 'react'
import axios from 'axios'

function LocationInfo(props) {
    

    const [location, setLocation] = useState({})
    const [nearestStation, setNearestStation] = useState("")
    const [distace, setDistance] = useState("")
    const [availableLines, setAvailableLines] = useState([])
    const [mapsLink, setMapsLink] = useState("")


    const API_URL = 'http://localhost:5005'
    const id = Object.values(props).join("")
   
    const getEvent = () => {
           axios.get(`${API_URL}/api/map/${id}`)
           .then(res => {
               setLocation(res.data.location)
               setNearestStation(res.data.location.nearestStation)
               setDistance(res.data.location.distance)
               setAvailableLines(res.data.location.availableLines)
               setMapsLink(res.data.location.mapsLink)
       })
    }
   
    useEffect(() => {
       getEvent()
   }, [])

   const berlinerLines = {
       u1 : "data:image/png;base64," ,
       u2 : "data:image/png;base64," ,
       u3 : "data:image/png;base64," ,
       u5 : "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQGtek3XyQCV4hPQKn6EYxz-NQE62PsmSyHCw&usqp=CAU" ,
       u7 : "data:image/png;base64," , 
       u4 : "data:image/png;base64," ,
       u6 : "data:image/png;base64," ,
       u8 : "data:image/png;base64," , 
       u9 : "data:image/png;base64," , 

       s1 : "data:image/png;base64," , 
       s2 : "data:image/png;base64," , 
       s3 : "data:image/png;base64," , 
       s41 : "data:image/jpeg;base64," , 
       s42 : "data:image/png;base64," , 
       s45 : "data:image/jpeg;base64," , 
       s46 : "data:image/jpeg;base64," , 
       s5 : "data:image/png;base64," , 
       s7 : "data:image/png;base64," , 
       s8 : "data:image/png;base64," , 
       s9 : "data:image/png;base64,"

   }

   return (
       <div id="locationInfo">
           <h3>@: {location.name}</h3>
            <a href={mapsLink}>google maps</a>
           <div id="nearestStation">
               <h3>{nearestStation}</h3>-<h3>{distace}m</h3>
           </div>
           <div id="availableLines">
               {availableLines.map(line => {
                   return (
                    <img id="lineIcon" alt="icon" src={berlinerLines[line]} />
                   )
               })}
           </div>
       </div>
   )

}

export default LocationInfo
